import React from "react";
import "./ExpenseList.css";

export default function ExpenseList({ list }) {
  if (!list || list.length === 0) return <p className="empty">Поки що немає витрат</p>;

  return (
    <ul className="expense-list">
      {list.map((item) => (
        <li className="expense-item" key={item.id}>
          <span><strong>{item.expense}</strong> - {item.price} грн</span>
          <span className="category">({item.category})</span>
        </li>
      ))}
    </ul>
  );
}
